int main() {
    int n, q, u, v;
    Node *tree[MAX_NODES];
    // Read the number of nodes
    scanf("%d", &n);

    // Initialize the tree
    for (int i = 0; i < n; i++) {
        tree[i] = create_node(i);
    }

    // Read the tree structure
    for (int i = 0; i < n; i++) {
        int k;
        scanf("%d", &k);
        for (int j = 0; j < k; j++) {
            int child;
            scanf("%d", &child);
            insert_child(tree[i], child);
        }
    }

    // Read the number of queries
    scanf("%d", &q);

    // Process each query
    for (int i = 0; i < q; i++) {
        // Read the nodes for the query
        scanf("%d %d", &u, &v);

        // Find the paths from root to the two nodes
        Path *path1 = find_path(tree, u);
        Path *path2 = find_path(tree, v);

        // Find the LCA of the two nodes
        int lca = find_lca(tree, path1, path2);

        // Print the LCA
        printf("%d\n", lca);

        // Free the paths
        while (path1 != NULL) {
            Path *temp = path1;
            path1 = path1->next;
            free(temp);
        }
        while (path2 != NULL) {
            Path *temp = path2;
            path2 = path2->next;
            free(temp);
        }
    }

    // Free the tree
    for (int i = 0; i < n; i++) {
        free(tree[i]);
    }

    return 0;
}
